import React from "react";
import SearchIcon from '@mui/icons-material/Search';
import NotificationsIcon from '@mui/icons-material/Notifications';
import { Badge,Avatar } from "@mui/material";
import img from "../profile.webp";


const Navbar = () => {
  return (
    <div className="flex justify-between items-center py-4 px-2"  style={{border:'3px solid red'}}>
      <div className="brandName">
        <h1 className="text-[22px]" >Chats</h1>
      </div>
      <div className="flex">
      <div
        className="flex flex-row items-center justify-center max-w-fit"
        style={{ border: "1px solid #728095", borderRadius:'10px' }}
      >
        <SearchIcon style = {{color:"#728095", marginLeft:'0.8rem'}}/>
        <input
          className="p-2 rounded-lg outline-none"
          type="search"
          name="search"
          id=""
          placeholder="Search"
        />
      </div>
      <div className="flex items-center">
        <Badge badgeContent={1} color="secondary">
          <NotificationsIcon color="action" />
        </Badge>
        <Avatar alt="Profile-Picture" src={img} />
      </div>
    </div>
    </div>
  );
};

export default Navbar;
